import React from 'react';
import Sidebar from './Sidebar';

const Bawg = () => {
	return (
		<div className="flex">
			<div className="mr4">
				<h1 className="baskerville bb b--moon-gray"><i>BAWG</i></h1>
	        </div>
	        <Sidebar />
         </div>
   	);
};

export default Bawg;
